import React from "react";
import "./Header.css";
import "./HorizontalneListe";
import HorizontalnaLista from "./HorizontalneListe";

function Header()
{
    return(
        <header>
            <div className="tekst">
                <HorizontalnaLista/>
            </div>
            <div className="ikone">
            <HorizontalnaLista/>
            </div>
        </header>
    );
}

export default Header;
